INSERT INTO `sys_log` VALUES ('1116', 'admin', '修改信息', 'com.szt.modules.generator.controller.GeneratorTemplateController.update()', '{\"id\":9,\"text\":\"\\u003ctemplate\\u003e\\n    \\u003cdiv class\\u003d\\\"mod-config\\\"\\u003e\\n        \\u003cel-form :inline\\u003d\\\"true\\\" :model\\u003d\\\"dataForm\\\" @keyup.enter.native\\u003d\\\"getDataList()\\\"\\u003e\\n            \\u003cel-form-item v-for\\u003d\\\"(item,indexs) in tableFieldMap[pathUrl].isSeekList\\\"\\u003e\\n                \\u003c!--时间选择框--\\u003e\\n                \\u003cel-tooltip class\\u003d\\\"item\\\" effect\\u003d\\\"dark\\\" :content\\u003d\\\"item.pageComment\\\" placement\\u003d\\\"top-start\\\" v-if\\u003d\\\"item.inputType\\u003d\\u003d\\u00272\\u0027|| item.inputType\\u003d\\u003d\\u00273\\u0027\\\"\\u003e\\n                    \\u003cel-date-picker\\n                            v-model\\u003d\\\"dataForm[item.fieldName]\\\" value-format\\u003d\\\"yyyy-MM-dd\\\"\\n                            type\\u003d\\\"daterange\\\"\\n                            range-separator\\u003d\\\"至\\\"\\n                            start-placeholder\\u003d\\\"开始日期\\\"\\n                            end-placeholder\\u003d\\\"结束日期\\\"\\u003e\\u003ctemplate slot\\u003d\\\"prepend\\\"\\u003e{{item.pageComment}}\\u003c/template\\u003e\\n                    \\u003c/el-date-picker\\u003e\\n                \\u003c/el-tooltip\\u003e\\n                \\u003c!--下拉选择--\\u003e\\n                \\u003cel-select  clearable  v-model\\u003d\\\"dataForm[item.fieldName]\\\" placeholder\\u003d\\\"请选择\\\" style\\u003d\\\"width:100%;\\\" v-else-if\\u003d\\\"item.inputType\\u003d\\u003d\\u00274\\u0027 || item.inputType\\u003d\\u003d\\u00275\\u0027\\\"\\u003e\\n                    \\u003cel-option\\n                            v-for\\u003d\\\"itemss in busConfig[pathUrl+item.fieldnames].list\\\"\\n                            :key\\u003d\\\"itemss.confName\\\"\\n                            :label\\u003d\\\"itemss.confName\\\"\\n                            :value\\u003d\\\"itemss.confVue\\\"\\u003e\\u003ctemplate slot\\u003d\\\"prepend\\\"\\u003e{{item.pageComment}}\\u003c/template\\u003e\\n                    \\u003c/el-option\\u003e\\n                \\u003c/el-select\\u003e\\n                \\u003c!--普通输入框--\\u003e\\n                \\u003cel-input v-model\\u003d\\\"dataForm[item.fieldName]\\\" :content\\u003d\\\"item.pageComment\\\" :placeholder\\u003d\\\"item.pageComment\\\" clearable v-else\\u003e\\u003ctemplate slot\\u003d\\\"prepend\\\"\\u003e{{item.pageComment}}\\u003c/template\\u003e\\u003c/el-input\\u003e\\n            \\u003c/el-form-item\\u003e\\n            \\u003cel-button @click\\u003d\\\"getDataList()\\\"\\u003e查询\\u003c/el-button\\u003e\\n            \\u003cel-button v-if\\u003d\\\"isAuth(\\u0027${moduleName}:${pathName}:save\\u0027)\\\" type\\u003d\\\"primary\\\" @click\\u003d\\\"addOrUpdateHandle()\\\"\\u003e新增\\n            \\u003c/el-button\\u003e\\n            \\u003cel-button v-if\\u003d\\\"isAuth(\\u0027${moduleName}:${pathName}:delete\\u0027)\\\" type\\u003d\\\"danger\\\" @click\\u003d\\\"deleteHandle()\\\" :disabled\\u003d\\\"dataListSelections.length \\u003c\\u003d 0\\\"\\u003e批量删除\\n            \\u003c/el-button\\u003e\\n        \\u003c/el-form\\u003e\\n        \\u003cel-table\\n                :default-sort\\u003d\\\"{prop: \\u0027id\\u0027, order: \\u0027ascending\\u0027}\\\"\\n                @sort-change\\u003d\\\"sort\\\"\\n                :data\\u003d\\\"dataList\\\"\\n                border  height\\u003d\\\"650\\\"\\n                v-loading\\u003d\\\"dataListLoading\\\"\\n                @selection-change\\u003d\\\"selectionChangeHandle\\\"\\n                style\\u003d\\\"width: 100%;\\\"\\u003e\\n            \\u003cel-table-column\\n                    srtable\\u003d\\\"custom\\\"\\n                    type\\u003d\\\"selection\\\"\\n                    header-align\\u003d\\\"center\\\"\\n                    align\\u003d\\\"center\\\"\\n                    width\\u003d\\\"50\\\"\\u003e\\n            \\u003c/el-table-column\\u003e\\n            \\u003cel-table-column v-for\\u003d\\\"(item,indexs) in tableFieldMap[pathUrl].tableSetList\\\"\\n                             sortable\\u003d\\\"custom\\\"\\n                             :prop\\u003d\\\"item.fieldName\\\"\\n                             header-align\\u003d\\\"center\\\"\\n                             align\\u003d\\\"center\\\" :label\\u003d\\\"item.pageComment\\\"\\u003e\\n                \\u003ctemplate slot-scope\\u003d\\\"scope\\\"\\u003e\\n                    \\u003c!--日期date--\\u003e\\n                    \\u003cspan v-if\\u003d\\\"item.inputType\\u003d\\u003d\\u003d\\u00272\\u0027\\\" v-text\\u003d\\\"scope.row[item.fieldName]\\\"\\u003e\\u003c/span\\u003e\\n                    \\u003c!-- 时间datetime--\\u003e\\n                    \\u003cspan v-else-if\\u003d\\\"item.inputType\\u003d\\u003d\\u003d\\u00273\\u0027\\\" v-text\\u003d\\\"scope.row[item.fieldName]\\\"\\u003e\\u003c/span\\u003e\\n                    \\u003c!--上传图片--\\u003e\\n                    \\u003cspan v-else-if\\u003d\\\"item.inputType\\u003d\\u003d\\u003d\\u00278\\u0027\\\"\\u003e\\n                      \\u003cimg :src\\u003d\\\"scope.row[item.fieldName]\\\" style\\u003d\\\"width:100%;height:100%;\\\"\\u003e\\n                    \\u003c/span\\u003e\\n                    \\u003c!--下拉选selec--\\u003e\\n                    \\u003cspan  v-else-if\\u003d\\\"item.inputType\\u003d\\u003d\\u00274\\u0027 || item.inputType\\u003d\\u003d\\u00275\\u0027\\\"  v-text\\u003d\\\"busConfig[pathUrl+item.fieldnames].map[scope.row[item.fieldName]]\\\" \\u003e  \\u003c/span\\u003e\\n                    \\u003cspan v-else v-text\\u003d\\\"scope.row[item.fieldName]\\\"\\u003e\\u003c/span\\u003e\\n                \\u003c/template\\u003e\\n            \\u003c/el-table-column\\u003e\\n            \\u003cel-table-column\\n                    fixed\\u003d\\\"right\\\"\\n                    header-align\\u003d\\\"center\\\"\\n                    align\\u003d\\\"center\\\"\\n                    width\\u003d\\\"150\\\"\\n                    label\\u003d\\\"操作\\\"\\u003e\\n                \\u003ctemplate slot-scope\\u003d\\\"scope\\\"\\u003e\\n                    \\u003cel-button type\\u003d\\\"text\\\" size\\u003d\\\"small\\\" @click\\u003d\\\"addOrUpdateHandle(scope.row.${pk.attrname})\\\"\\u003e修改\\n                    \\u003c/el-button\\u003e\\n                    \\u003cel-button type\\u003d\\\"text\\\" size\\u003d\\\"small\\\" @click\\u003d\\\"deleteHandle(scope.row.${pk.attrname})\\\"\\u003e删除\\u003c/el-button\\u003e\\n                \\u003c/template\\u003e\\n            \\u003c/el-table-column\\u003e\\n        \\u003c/el-table\\u003e\\n        \\u003cel-pagination\\n                @size-change\\u003d\\\"sizeChangeHandle\\\"\\n                @current-change\\u003d\\\"currentChangeHandle\\\"\\n                :current-page\\u003d\\\"pageIndex\\\"\\n                :page-sizes\\u003d\\\"[10, 20, 50, 100]\\\"\\n                :page-size\\u003d\\\"pageSize\\\"\\n                :total\\u003d\\\"totalPage\\\"\\n                layout\\u003d\\\"total, sizes, prev, pager, next, jumper\\\"\\u003e\\n        \\u003c/el-pagination\\u003e\\n        \\u003c!-- 弹窗, 新增 / 修改 --\\u003e\\n        \\u003cadd-or-update v-if\\u003d\\\"addOrUpdateVisible\\\" ref\\u003d\\\"addOrUpdate\\\" @refreshDataList\\u003d\\\"getDataList\\\"\\u003e\\u003c/add-or-update\\u003e\\n    \\u003c/div\\u003e\\n\\u003c/template\\u003e\\n\\n\\u003cscript\\u003e\\n    import API from \\u0027@/api\\u0027\\n    import AddOrUpdate from \\u0027./add-or-update\\u0027\\n\\n    export default {\\n        data() {\\n            return {\\n                pathUrl: \\u0027${pathUrl}\\u0027,\\n                busConfig: this.busConfig,\\n                tableFieldMap: this.tableFieldMap,\\n                sysurl: window.SITE_CONFIG.baseUrl,\\n                dataForm: {\\n                    createTime: null\\n       