INSERT INTO `sys_log` VALUES ('1145', 'admin', '修改信息', 'com.szt.modules.generator.controller.GeneratorTemplateController.update()', '{\"id\":9,\"text\":\"\\u003ctemplate\\u003e\\n    \\u003cdiv class\\u003d\\\"mod-config\\\"\\u003e\\n        \\u003cel-form :inline\\u003d\\\"true\\\" :model\\u003d\\\"dataForm\\\" @keyup.enter.native\\u003d\\\"getDataList()\\\"\\u003e\\n            \\u003cel-form-item v-for\\u003d\\\"(item,indexs) in tableFieldMap[pathUrl].isSeekList\\\"\\u003e\\n                \\u003c!--时间选择框--\\u003e\\n                \\u003cel-tooltip class\\u003d\\\"item\\\" effect\\u003d\\\"dark\\\" :content\\u003d\\\"item.pageComment\\\" placement\\u003d\\\"top-start\\\" v-if\\u003d\\\"item.inputType\\u003d\\u003d\\u00272\\u0027|| item.inputType\\u003d\\u003d\\u00273\\u0027\\\"\\u003e\\n                    \\u003cel-date-picker\\n                            v-model\\u003d\\\"dataForm[item.fieldName]\\\" value-format\\u003d\\\"yyyy-MM-dd\\\"\\n                            type\\u003d\\\"daterange\\\"\\n                            range-separator\\u003d\\\"至\\\"\\n                            start-placeholder\\u003d\\\"开始日期\\\"\\n                            end-placeholder\\u003d\\\"结束日期\\\"\\u003e\\u003ctemplate slot\\u003d\\\"prepend\\\"\\u003e{{item.pageComment}}\\u003c/template\\u003e\\n                    \\u003c/el-date-picker\\u003e\\n                \\u003c/el-tooltip\\u003e\\n                \\u003c!--下拉选择--\\u003e\\n                \\u003cel-select  clearable  v-model\\u003d\\\"dataForm[item.fieldName]\\\" placeholder\\u003d\\\"item.pageComment\\\" style\\u003d\\\"width:100%;\\\" v-else-if\\u003d\\\"item.inputType\\u003d\\u003d\\u00274\\u0027 || item.inputType\\u003d\\u003d\\u00275\\u0027\\\"\\u003e\\n                    \\u003cel-option\\n                            v-for\\u003d\\\"itemss in busConfig[pathUrl+item.fieldnames].list\\\"\\n                            :key\\u003d\\\"itemss.confName\\\"\\n                            :label\\u003d\\\"itemss.confName\\\"\\n                            :value\\u003d\\\"itemss.confVue\\\"\\u003e\\u003ctemplate slot\\u003d\\\"prepend\\\"\\u003e{{item.pageComment}}\\u003c/template\\u003e\\n                    \\u003c/el-option\\u003e\\n                \\u003c/el-select\\u003e\\n                \\u003c!--普通输入框--\\u003e\\n                \\u003cel-input v-model\\u003d\\\"dataForm[item.fieldName]\\\" :content\\u003d\\\"item.pageComment\\\" :placeholder\\u003d\\\"item.pageComment\\\" clearable v-else\\u003e\\u003ctemplate slot\\u003d\\\"prepend\\\"\\u003e{{item.pageComment}}\\u003c/template\\u003e\\u003c/el-input\\u003e\\n            \\u003c/el-form-item\\u003e\\n            \\u003cel-button @click\\u003d\\\"getDataList()\\\"\\u003e查询\\u003c/el-button\\u003e\\n            \\u003cel-button v-if\\u003d\\\"isAuth(\\u0027${moduleName}:${pathName}:save\\u0027)\\\" type\\u003d\\\"primary\\\" @click\\u003d\\\"addOrUpdateHandle()\\\"\\u003e新增\\n            \\u003c/el-button\\u003e\\n            \\u003cel-button v-if\\u003d\\\"isAuth(\\u0027${moduleName}:${pathName}:delete\\u0027)\\\" type\\u003d\\\"danger\\\" @click\\u003d\\\"deleteHandle()\\\" :disabled\\u003d\\\"dataListSelections.length \\u003c\\u003d 0\\\"\\u003e批量删除\\n            \\u003c/el-button\\u003e\\n        \\u003c/el-form\\u003e\\n        \\u003cel-table\\n                :default-sort\\u003d\\\"{prop: \\u0027id\\u0027, order: \\u0027ascending\\u0027}\\\"\\n                @sort-change\\u003d\\\"sort\\\"\\n                :data\\u003d\\\"dataList\\\"\\n                border  height\\u003d\\\"650\\\"\\n                v-loading\\u003d\\\"dataListLoading\\\"\\n                @selection-change\\u003d\\\"selectionChangeHandle\\\"\\n                style\\u003d\\\"width: 100%;\\\"\\u003e\\n            \\u003cel-table-column\\n                    srtable\\u003d\\\"custom\\\"\\n                    type\\u003d\\\"selection\\\"\\n                    header-align\\u003d\\\"center\\\"\\n                    align\\u003d\\\"center\\\"\\n                    width\\u003d\\\"50\\\"\\u003e\\n            \\u003c/el-table-column\\u003e\\n            \\u003cel-table-column v-for\\u003d\\\"(item,indexs) in tableFieldMap[pathUrl].tableSetList\\\"\\n                             sortable\\u003d\\\"custom\\\"\\n                             :prop\\u003d\\\"item.fieldName\\\"\\n                             header-align\\u003d\\\"center\\\"\\n                             align\\u003d\\\"center\\\" :label\\u003d\\\"item.pageComment\\\"\\u003e\\n                \\u003ctemplate slot-scope\\u003d\\\"scope\\\"\\u003e\\n                    \\u003c!--日期date--\\u003e\\n                    \\u003cspan v-if\\u003d\\\"item.inputType\\u003d\\u003d\\u003d\\u00272\\u0027\\\" v-text\\u003d\\\"scope.row[item.fieldName]\\\"\\u003e\\u003c/span\\u003e\\n                    \\u003c!-- 时间datetime--\\u003e\\n                    \\u003cspan v-else-if\\u003d\\\"item.inputType\\u003d\\u003d\\u003d\\u00273\\u0027\\\" v-text\\u003d\\\"scope.row[item.fieldName]\\\"\\u003e\\u003c/span\\u003e\\n                    \\u003c!--上传图片--\\u003e\\n                    \\u003cspan v-else-if\\u003d\\\"item.inputType\\u003d\\u003d\\u003d\\u00278\\u0027\\\"\\u003e\\n                     \\u003cimg :src\\u003d\\\"scope.row[item.fieldName]\\\" style\\u003d\\\"width:50px;height:50px;\\\"\\u003e\\n                    \\u003c/span\\u003e\\n                    \\u003c!--下拉选selec--\\u003e\\n                    \\u003cspan  v-else-if\\u003d\\\"item.inputType\\u003d\\u003d\\u00274\\u0027 || item.inputType\\u003d\\u003d\\u00275\\u0027\\\"  v-text\\u003d\\\"busConfig[pathUrl+item.fieldnames].map[scope.row[item.fieldName]]\\\" \\u003e  \\u003c/span\\u003e\\n                    \\u003cspan v-else v-text\\u003d\\\"scope.row[item.fieldName]\\\"\\u003e\\u003c/span\\u003e\\n                \\u003c/template\\u003e\\n            \\u003c/el-table-column\\u003e\\n            \\u003cel-table-column\\n                    fixed\\u003d\\\"right\\\"\\n                    header-align\\u003d\\\"center\\\"\\n                    align\\u003d\\\"center\\\"\\n                    width\\u003d\\\"150\\\"\\n                    label\\u003d\\\"操作\\\"\\u003e\\n                \\u003ctemplate slot-scope\\u003d\\\"scope\\\"\\u003e\\n                    \\u003cel-button type\\u003d\\\"text\\\" size\\u003d\\\"small\\\" @click\\u003d\\\"addOrUpdateHandle(scope.row.${pk.attrname})\\\"\\u003e修改\\n                    \\u003c/el-button\\u003e\\n                    \\u003cel-button type\\u003d\\\"text\\\" size\\u003d\\\"small\\\" @click\\u003d\\\"deleteHandle(scope.row.${pk.attrname})\\\"\\u003e删除\\u003c/el-button\\u003e\\n                \\u003c/template\\u003e\\n            \\u003c/el-table-column\\u003e\\n        \\u003c/el-table\\u003e\\n        \\u003cel-pagination\\n                @size-change\\u003d\\\"sizeChangeHandle\\\"\\n                @current-change\\u003d\\\"currentChangeHandle\\\"\\n                :current-page\\u003d\\\"pageIndex\\\"\\n                :page-sizes\\u003d\\\"[10, 20, 50, 100]\\\"\\n                :page-size\\u003d\\\"pageSize\\\"\\n                :total\\u003d\\\"totalPage\\\"\\n                layout\\u003d\\\"total, sizes, prev, pager, next, jumper\\\"\\u003e\\n        \\u003c/el-pagination\\u003e\\n        \\u003c!-- 弹窗, 新增 / 修改 --\\u003e\\n        \\u003cadd-or-update v-if\\u003d\\\"addOrUpdateVisible\\\" ref\\u003d\\\"addOrUpdate\\\" @refreshDataList\\u003d\\\"getDataList\\\"\\u003e\\u003c/add-or-update\\u003e\\n    \\u003c/div\\u003e\\n\\u003c/template\\u003e\\n\\n\\u003cscript\\u003e\\n    import API from \\u0027@/api\\u0027\\n    import AddOrUpdate from \\u0027./add-or-update\\u0027\\n\\n    export default {\\n        data() {\\n            return {\\n                pathUrl: \\u0027${pathUrl}\\u0027,\\n                busConfig: this.busConfig,\\n                tableFieldMap: this.tableFieldMap,\\n                sysurl: window.SITE_CONFIG.baseUrl,\\n                dataForm: {\\n                    createTime: null\\n                },\\n                sortData: {\\n                    order: null,\\n                    sidx: null\\n                },\\n                dataList: [],\\n                pageIndex: 1,\\n                pageSize: 10,\\n                totalPage: 0,\\n                dataListLoading: false,\\n                dataListSelections: [],\\n                addOrUpdateVisible: false\\n            }\\n        },\\n        components: {\\n            AddOrUpdate\\n        },\\n        activated() {\\n            this.getDataList()\\n        },\\n        methods: {\\n            sort(value) {\\n                this.sortData.sidx \\u003d value.prop\\n                this.sortData.order \\u003d value.order \\u003d\\u003d\\u003d \\u0027descending\\u0027 ? \\u0027desc\\u0027 : \\u0027asc\\u0027\\n                this.getDataList()\\n            },\\n            // 获取数据列表\\n            getDataList() {\\n                this.dataListLoading \\u003d true\\n                var params \\u003d {\\n                    page: this.pageIndex,\\n                    limit: this.pageSize,\\n                    sidx: this.sortData.sidx,\\n                    order: this.sortData.order\\n                }\\n                for (var key in this.dataForm) {\\n                    if (this.dataForm[key]) {\\n                        if (this.dataForm[key] instanceof Array) {\\n                            params[key] \\u003d JSON.stringify(this.dataForm[key])\\n                        } else {\\n                            params[key] \\u003d this.dataForm[key]\\n                        }\\n                    }\\n                }\\n                API.${pathName}.list(params).then(({data}) \\u003d\\u003e {\\n                    if (data \\u0026\\u0026 data.code \\u003d\\u003d\\u003d 0) {\\n                    this.dataList \\u003d data.data.list\\n                    this.totalPage \\u003d data.data.totalCount\\n                } else {\\n                    this.dataList \\u003d []\\n                    this.totalPage \\u003d 0\\n                }\\n                this.dataListLoading \\u003d false\\n            })\\n            },\\n            // 每页数\\n            sizeChangeHandle(val) {\\n                this.pageSize \\u003d val\\n                this.pageIndex \\u003d 1\\n                this.getDataList()\\n            },\\n            // 当前页\\n            currentChangeHandle(val) {\\n                this.pageIndex \\u003d val\\n                this.getDataList()\\n            },\\n            // 多选\\n            selectionChangeHandle(val) {\\n                this.dataListSelections \\u003d val\\n            },\\n            // 新增 / 修改\\n            addOrUpdateHandle(id) {\\n                this.addOrUpdateVisible \\u003d true\\n                this.$nextTick(() \\u003d\\u003e {\\n                    this.$refs.addOrUpdate.init(id)\\n            })\\n            },\\n            // 删除\\n            deleteHandle (id) {\\n                var ids \\u003d id ? [id] : this.dataListSelections.map(item \\u003d\\u003e {\\n                    return item.${pk.attrname}\\n                })\\n            #[[this.$confirm(`确定对[id\\u003d${ids.join(\\u0027,\\u0027)}]进行[${id ? \\u0027删除\\u0027 : \\u0027批量删除\\u0027}]操作?`, \\u0027提示\\u0027, {]]#\\n                confirmButtonText: \\u0027确定\\u0027,\\n                        cancelButtonText: \\u0027取消\\u0027,\\n                        type: \\u0027warning\\u0027\\n            }).then(() \\u003d\\u003e {\\n                    API.${pathName}.del(ids).then(({data}) \\u003d\\u003e {\\n                    if (data \\u0026\\u0026 data.code \\u003d\\u003d\\u003d 0) {\\n                    this.$message({\\n                        message: \\u0027操作成功\\u0027,\\n                        type: \\u0027success\\u0027,\\n                        duration: 1500,\\n                        onClose: () \\u003d\\u003e {\\n                        this.getDataList()\\n                }\\n                })\\n                } else {\\n                #[[this.$message.error(data.msg)]]#\\n                }\\n            })\\n            })\\n            }\\n        }\\n    }\\n\\u003c/script\\u003e\\n\",\"remark\":\"vue表格模板\",\"url\":\"src/views/$[moduleName]/$[className.toLowerCase()]/index.vue\",\"fileName\":\"elementui\\\\index.vue.vm\",\"versionNo\":1,\"createBy\":1,\"createTime\":\"May 29, 2018 4:33:18 AM\",\"updateBy\":1,\"updateTime\":\"Jun 19, 2018 11:24:39 PM\",\"deleteFlag\":\"0\",\"sort\":1}', '19', '0:0:0:0:0:0:0:1', null, '1', null, '2018-06-19 23:24:39', null, '2018-06-19 23:24:39', '0', '0');
