                   dataForm: {\\n\\n\\n\\t           #foreach($column in $columns)\\n\\n\\n\\t               #if($column.fieldName\\u003d\\u003d $pk.fieldName)\\n\\n\\n\\t                   ${column.attrname}: 0,\\n\\n\\n\\t               #else\\n\\n\\n\\t                   ${column.attrname}: \\u0027\\u0027#if($velocityCount !\\u003d $columns.size()),#end\\n\\n\\n\\t\\n\\n\\n\\t               #end\\n\\n\\n\\t           #end\\n\\n\\n\\t           },\\n\\n\\n\\t           dataRule: {\\n\\n\\n\\t         \\n\\n\\n\\t           }\\n\\n\\n\\t       }\\n\\n\\n\\t       },\\n\\n\\n\\t       methods: {\\n\\n\\n\\t           init (id) {\\n\\n\\n\\t               this.dataForm.id \\u003d id || 0\\n\\n\\n\\t               this.visible \\u003d true\\n\\n\\n\\t               for (var i \\u003d 0; i \\u003c this.tableFieldMap[this.pathUrl].isSetList.length; i++) {\\n\\n\\n\\t                   var cou \\u003d this.tableFieldMap[this.pathUrl].isSetList[i]\\n\\n\\n\\t                   if (cou.isNull \\u003d\\u003d\\u003d \\u00271\\u0027) {\\n\\n\\n\\t                       this.dataRule[cou.fieldName] \\u003d [\\n\\n\\n\\t                           { required: true, message: cou.pageComment + \\u0027不能为空\\u0027, trigger: \\u0027blur\\u0027 }\\n\\n\\n\\t                       ]\\n\\n\\n\\t                   }\\n\\n\\n\\t               }\\n\\n\\n\\t               this.$nextTick(() \\u003d\\u003e {\\n\\n\\n\\t                   this.$refs[\\u0027dataForm\\u0027].resetFields()\\n\\n\\n\\t               if (id) {\\n\\n\\n\\t                   API.${pathName}.info(id).then(({data}) \\u003d\\u003e {\\n\\n\\n\\t                       if (data \\u0026\\u0026 data.code \\u003d\\u003d\\u003d 0) {\\n\\n\\n\\t                       for (var i \\u003d 0; i \\u003c this.tableFieldMap[this.pathUrl].columns.length; i++) {\\n\\n\\n\\t                           var cou \\u003d this.tableFieldMap[this.pathUrl].columns[i]\\n\\n\\n\\t                           // 初始化字段\\n\\n\\n\\t                           if (cou.inputType \\u003d\\u003d\\u003d \\u00275\\u0027) {\\n\\n\\n\\t                               if (!data.data[cou.fieldName]) {\\n\\n\\n\\t                                   this.dataForm[cou.fieldName] \\u003d []\\n\\n\\n\\t                               } else {\\n\\n\\n\\t                                   var arr \\u003d JSON.parse(data.data[cou.fieldName])\\n\\n\\n\\t                                   if (arr instanceof Array) {\\n\\n\\n\\t                                       this.dataForm[cou.fieldName] \\u003d arr\\n\\n\\n\\t                                   } else {\\n\\n\\n\\t                                       arr +\\u003d \\u0027\\u0027\\n\\n\\n\\t                                       this.dataForm[cou.fieldName] \\u003d [arr]\\n\\n\\n\\t                                   }\\n\\n\\n\\t                               }\\n\\n\\n\\t                           } else if (cou.inputType \\u003d\\u003d\\u003d \\u00279\\u0027) {\\n\\n\\n\\t                               if (!data.data[cou.fieldName]) {\\n\\n\\n\\t                                   this.dataForm[cou.fieldName] \\u003d []\\n\\n\\n\\t                               } else {\\n\\n\\n\\t                                   var arrayImg \\u003d JSON.parse(data.data[cou.fieldName])\\n\\n\\n\\t                                   if (arrayImg instanceof Array) {\\n\\n\\n\\t                                       this.dataForm[cou.fieldName] \\u003d arrayImg\\n\\n\\n\\t                                   } else {\\n\\n\\n\\t                                       this.dataForm[cou.fieldName] \\u003d [{uid: 999, name: cou.fieldName, url: arrayImg}]\\n\\n\\n\\t                                   }\\n\\n\\n\\t                               }\\n\\n\\n\\t                           } else {\\n\\n\\n\\t                               this.dataForm[cou.fieldName] \\u003d data.data[cou.fieldName]\\n\\n\\n\\t                           }\\n\\n\\n\\t                       }\\n\\n\\n\\t                   }\\n\\n\\n\\t               })\\n\\n\\n\\t               }\\n\\n\\n\\t           })\\n\\n\\n\\t           },\\n\\n\\n\\t           // 多图片上传删除事件\\n\\n\\n\\t           handleRemove (file, fileList) {\\n\\n\\n\\t               this.dataForm[file.name] \\u003d fileList\\n\\n\\n\\t           },\\n\\n\\n\\t           // 预览多图片事件\\n\\n\\n\\t           handlePictureCardPreview: function (file) {\\n\\n\\n\\t               this.prewImgLoad \\u003d true\\n\\n\\n\\t               this.prewImg \\u003d file.url\\n\\n\\n\\t           },\\n\\n\\n\\t           // 添加多图片上传事件\\n\\n\\n\\t           handleAvatarSuccess (res, file) {\\n\\n\\n\\t               if (this.dataForm[res.fieldName] instanceof Array) {\\n\\n\\n\\t                   this.dataForm[res.fieldName].push({name: res.fieldName, url: res.url})\\n\\n\\n\\t               } else {\\n\\n\\n\\t                   this.dataForm[res.fieldName] \\u003d res.url\\n\\n\\n\\t               }\\n\\n\\n\\t           },\\n\\n\\n\\t           // 图片上传格式验证\\n\\n\\n\\t           beforeAvatarUpload (file) {\\n\\n\\n\\t               const isJPG \\u003d file.type \\u003d\\u003d\\u003d \\u0027image/jpeg\\u0027\\n\\n\\n\\t               const isLt2M \\u003d file.size / 1024 / 1024 \\u003c 2\\n\\n\\n\\t               return true\\n\\n\\n\\t           },\\n\\n\\n\\t           // 表单提交\\n\\n\\n\\t           dataFormSubmit () {\\n\\n\\n\\t               #[[this.$refs[\\u0027dataForm\\u0027].validate((valid) \\u003d\\u003e {]]#\\n\\n\\n\\t                       if (valid) {\\n\\n\\n\\t                   var params \\u003d {\\n\\n\\n\\t                   #foreach($column in $columns)\\n\\n\\n\\t                   #if($column.fieldName\\u003d\\u003d $pk.columnName)\\n\\n\\n\\t                   \\u0027${column.attrname}\\u0027: this.dataForm.${column.attrname} || undefined,\\n\\n\\n\\t                           #else\\n\\n\\n\\t                               \\n\\n\\n\\t                   \\u0027${column.attrname}\\u0027: this.dataForm.${column.attrname}#if($velocityCount !\\u003d $columns.size()),#end\\n\\n\\n\\t                   #end\\n\\n\\n\\t                   #end\\n\\n\\n\\t               }\\n\\n\\n\\t                   var tick \\u003d !this.dataForm.${pk.attrname} ? API.${pathName}.add(params) : API.${pathName}.update(params)\\n\\n\\n\\t                   tick.then(({data}) \\u003d\\u003e {\\n\\n\\n\\t                       if (data \\u0026\\u0026 data.code \\u003d\\u003d\\u003d 0) {\\n\\n\\n\\t                           #[[this.$message({]]#\\n\\n\\n\\t                                   message: \\u0027操作成功\\u0027,\\n\\n\\n\\t                                   type: \\u0027success\\u0027,\\n\\n\\n\\t                                   duration: 1500,\\n\\n\\n\\t                                   onClose: () \\u003d\\u003e {\\n\\n\\n\\t                               this.visible \\u003d false\\n\\n\\n\\t                               #[[this.$emit(\\u0027refreshDataList\\u0027)]]#\\n\\n\\n\\t                           }\\n\\n\\n\\t                       })\\n\\n\\n\\t                       } else {\\n\\n\\n\\t                           #[[this.$message.error(data.msg)]]#\\n\\n\\n\\t                       }\\n\\n\\n\\t                   })\\n\\n\\n\\t               }\\n\\n\\n\\t               })\\n\\n\\n\\t           }\\n\\n\\n\\t       }\\n\\n\\n\\t   }\\n\\n\\n\\t\\u003c/script\\u003e\",\"remark\":\"vue新增修改模板\",\"url\":\"src/views/$[moduleName]/$[className.toLowerCase()]/add-or-update.vue\",\"fileName\":\"elementui\\\\add-or-update.vue.vm\",\"versionNo\":1,\"createBy\":1,\"createTime\":\"May 29, 2018 4:31:23 AM\",\"updateBy\":1,\"updateTime\":\"Jun 20, 2018 5:35:32 AM\",\"deleteFlag\":\"0\",\"sort\":1}', '11', '0:0:0:0:0:0:0:1', null, '1', null, '2018-06-20 05:35:32', null, '2018-06-20 05:35:32', '0', '0');
