      if (cou.inputType \\u003d\\u003d\\u003d \\u00275\\u0027) {\\n\\n\\n\\t                               if (!data.data[cou.fieldName]) {\\n\\n\\n\\t                                   this.dataForm[cou.fieldName] \\u003d []\\n\\n\\n\\t                               } else {\\n\\n\\n\\t                                   var arr \\u003d JSON.parse(data.data[cou.fieldName])\\n\\n\\n\\t                                   if (arr instanceof Array) {\\n\\n\\n\\t                                       this.dataForm[cou.fieldName] \\u003d arr\\n\\n\\n\\t                                   } else {\\n\\n\\n\\t                                       arr +\\u003d \\u0027\\u0027\\n\\n\\n\\t                                       this.dataForm[cou.fieldName] \\u003d [arr]\\n\\n\\n\\t                                   }\\n\\n\\n\\t                               }\\n\\n\\n\\t                           } else if (cou.inputType \\u003d\\u003d\\u003d \\u00279\\u0027) {\\n\\n\\n\\t                               if (!data.data[cou.fieldName]) {\\n\\n\\n\\t                                   this.dataForm[cou.fieldName] \\u003d []\\n\\n\\n\\t                               } else {\\n\\n\\n\\t                                   var arrayImg \\u003d JSON.parse(data.data[cou.fieldName])\\n\\n\\n\\t                                   if (arrayImg instanceof Array) {\\n\\n\\n\\t                                       this.dataForm[cou.fieldName] \\u003d arrayImg\\n\\n\\n\\t                                   } else {\\n\\n\\n\\t                                       this.dataForm[cou.fieldName] \\u003d [{uid: 999, name: cou.fieldName, url: arrayImg}]\\n\\n\\n\\t                                   }\\n\\n\\n\\t                               }\\n\\n\\n\\t                           } else {\\n\\n\\n\\t                               this.dataForm[cou.fieldName] \\u003d data.data[cou.fieldName]\\n\\n\\n\\t                           }\\n\\n\\n\\t                       }\\n\\n\\n\\t                   }\\n\\n\\n\\t               })\\n\\n\\n\\t               }\\n\\n\\n\\t           })\\n\\n\\n\\t           },\\n\\n\\n\\t           // 多图片上传删除事件\\n\\n\\n\\t           handleRemove (file, fileList) {\\n\\n\\n\\t               this.dataForm[file.name] \\u003d fileList\\n\\n\\n\\t           },\\n\\n\\n\\t           // 预览多图片事件\\n\\n\\n\\t           handlePictureCardPreview: function (file) {\\n\\n\\n\\t               this.prewImgLoad \\u003d true\\n\\n\\n\\t               this.prewImg \\u003d file.url\\n\\n\\n\\t           },\\n\\n\\n\\t           // 添加多图片上传事件\\n\\n\\n\\t           handleAvatarSuccess (res, file) {\\n\\n\\n\\t               if (this.dataForm[res.fieldName] instanceof Array) {\\n\\n\\n\\t                   this.dataForm[res.fieldName].push({name: res.fieldName, url: res.url})\\n\\n\\n\\t               } else {\\n\\n\\n\\t                   this.dataForm[res.fieldName] \\u003d res.url\\n\\n\\n\\t               }\\n\\n\\n\\t           },\\n\\n\\n\\t           // 图片上传格式验证\\n\\n\\n\\t           beforeAvatarUpload (file) {\\n\\n\\n\\t               const isJPG \\u003d file.type \\u003d\\u003d\\u003d \\u0027image/jpeg\\u0027\\n\\n\\n\\t               const isLt2M \\u003d file.size / 1024 / 1024 \\u003c 2\\n\\n\\n\\t               return true\\n\\n\\n\\t           },\\n\\n\\n\\t           // 表单提交\\n\\n\\n\\t           dataFormSubmit () {\\n\\n\\n\\t               #[[this.$refs[\\u0027dataForm\\u0027].validate((valid) \\u003d\\u003e {]]#\\n\\n\\n\\t                       if (valid) {\\n\\n\\n\\t                   var params \\u003d {\\n\\n\\n\\t                   #foreach($column in $columns)\\n\\n\\n\\t                   #if($column.fieldName\\u003d\\u003d $pk.columnName)\\n\\n\\n\\t                   \\u0027${column.attrname}\\u0027: this.dataForm.${column.attrname} || undefined,\\n\\n\\n\\t                           #else\\n\\n\\n\\t                               \\n\\n\\n\\t                   \\u0027${column.attrname}\\u0027: this.dataForm.${column.attrname}#if($velocityCount !\\u003d $columns.size()),#end\\n\\n\\n\\t                   #end\\n\\n\\n\\t                   #end\\n\\n\\n\\t               }\\n\\n\\n\\t                   var tick \\u003d !this.dataForm.${pk.attrname} ? API.${pathName}.add(params) : API.${pathName}.update(params)\\n\\n\\n\\t                   tick.then(({data}) \\u003d\\u003e {\\n\\n\\n\\t                       if (data \\u0026\\u0026 data.code \\u003d\\u003d\\u003d 0) {\\n\\n\\n\\t                           #[[this.$message({]]#\\n\\n\\n\\t                                   message: \\u0027操作成功\\u0027,\\n\\n\\n\\t                                   type: \\u0027success\\u0027,\\n\\n\\n\\t                                   duration: 1500,\\n\\n\\n\\t                                   onClose: () \\u003d\\u003e {\\n\\n\\n\\t                               this.visible \\u003d false\\n\\n\\n\\t                               #[[this.$emit(\\u0027refreshDataList\\u0027)]]#\\n\\n\\n\\t                           }\\n\\n\\n\\t                       })\\n\\n\\n\\t                       } else {\\n\\n\\n\\t                           #[[this.$message.error(data.msg)]]#\\n\\n\\n\\t                       }\\n\\n\\n\\t                   })\\n\\n\\n\\t               }\\n\\n\\n\\t               })\\n\\n\\n\\t           }\\n\\n\\n\\t       }\\n\\n\\n\\t   }\\n\\n\\n\\t\\u003c/script\\u003e\",\"remark\":\"vue新增修改模板\",\"url\":\"src/views/$[moduleName]/$[className.toLowerCase()]/add-or-update.vue\",\"fileName\":\"elementui\\\\add-or-update.vue.vm\",\"versionNo\":1,\"createBy\":1,\"createTime\":\"May 29, 2018 4:31:23 AM\",\"updateBy\":1,\"updateTime\":\"Jun 20, 2018 5:58:18 AM\",\"deleteFlag\":\"0\",\"sort\":1}', '20', '0:0:0:0:0:0:0:1', null, '1', null, '2018-06-20 05:58:18', null, '2018-06-20 05:58:18', '0', '0');
INSERT INTO `sys_log` VALUES ('1169', 'admin', '修改信息', 'com.szt.modules.generator.controller.GeneratorTemplateController.update()', '{\"id\":7,\"text\":\"\\u003ctemplate\\u003e\\t   \\u003cel-dialog\\t           :title\\u003d\\\"!dataForm.id ? \\u0027新增\\u0027 : \\u0027修改\\u0027\\\" :modal-append-to-body\\u003d\\\"false\\\"\\t           :close-on-click-modal\\u003d\\\"false\\\"\\t           :visible.sync\\u003d\\\"visible\\\"\\u003e\\t       \\u003cel-form :model\\u003d\\\"dataForm\\\" :rules\\u003d\\\"dataRule\\\" ref\\u003d\\\"dataForm\\\" @keyup.enter.native\\u003d\\\"dataFormSubmit()\\\" label-width\\u003d\\\"80px\\\"\\u003e\\t           \\u003cel-form-item :label\\u003d\\\"item.pageComment\\\" :prop\\u003d\\\"item.fieldName\\\" v-for\\u003d\\\"(item,indexs) in tableFieldMap[pathUrl].isSetList\\\"\\u003e\\t               \\u003c!--数字number--\\u003e\\t               \\u003cel-input-number v-model\\u003d\\\"dataForm[item.fieldName]\\\" :placeholder\\u003d\\\"item.pageComment\\\" v-if\\u003d\\\"item.inputType\\u003d\\u003d\\u003d\\u00271\\u0027\\\" :min\\u003d\\\"1\\\" \\u003e\\u003c/el-input-number\\u003e\\t               \\u003c!--日期date--\\u003e\\t               \\u003cel-date-picker v-model\\u003d\\\"dataForm[item.fieldName]\\\"  v-else-if\\u003d\\\"item.inputType\\u003d\\u003d\\u003d\\u00272\\u0027\\\" type\\u003d\\\"date\\\" style\\u003d\\\"width:100%;\\\" value-format\\u003d\\\"yyyy-MM-dd\\\"  :placeholder\\u003d\\\"item.pageComment\\\" format\\u003d\\\"yyyy-MM-dd\\\"\\u003e \\u003c/el-date-picker\\u003e\\t               \\u003c!--时间datetime--\\u003e\\t               \\u003cel-date-picker v-model\\u003d\\\"dataForm[item.fieldName]\\\"  value-format\\u003d\\\"yyyy-MM-dd HH:mm:ss\\\"  format\\u003d\\\"yyyy-MM-dd HH:mm:ss\\\" :placeholder\\u003d\\\"item.pageComment\\\" type\\u003d\\\"datetime\\\" style\\u003d\\\"width:100%;\\\"  v-else-if\\u003d\\\"item.inputType\\u003d\\u003d\\u003d\\u00273\\u0027\\\"\\u003e\\u003c/el-date-picker\\u003e\\t               \\u003