-- Table structure for xjdc_demand
-- ----------------------------
DROP TABLE IF EXISTS `xjdc_demand`;
CREATE TABLE `xjdc_demand` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `openid` varchar(200) NOT NULL COMMENT 'openid',
  `provider_type` varchar(6) DEFAULT NULL COMMENT '供应商类型@0-业主,1-代理人',
  `pay_type` varchar(6) DEFAULT NULL COMMENT '支付类型@0-一次性,1-按揭',
  `name` varchar(100) NOT NULL COMMENT '联系人',
  `facility` varchar(500) DEFAULT NULL COMMENT '配套设备&0-电视,1-冰箱,2-洗衣机,3-空调,4-沙发,5-柜子,6-床,7-衣橱,8-宽带,9-暖气,10-热水器,11-天然气',
  `phone` varchar(200) NOT NULL COMMENT '联系电话',
  `household` varchar(6) DEFAULT NULL COMMENT '是否家电@0-带家电,1-不带家电',
  `region` varchar(255) NOT NULL COMMENT '区域',
  `price` varchar(255) NOT NULL COMMENT '价格',
  `has_elevator` varchar(6) DEFAULT NULL COMMENT '是否电梯@0-是,1-否',
  `house_type` varchar(20) DEFAULT NULL COMMENT '户型&0-单间,1-一室一厅,2-二室一厅,3-三室一厅,4-其他',
  `square` decimal(20,2) DEFAULT NULL COMMENT '平方数',
  `type` varchar(20) DEFAULT NULL COMMENT '类型@1-商品房,2-自建房,3-公寓,4-宅基地',
  `building_age` int(200) DEFAULT NULL COMMENT '楼龄',
  `floor` varchar(255) DEFAULT NULL COMMENT '楼层@0-低层,1-中层,2-高层',
  `decoration` varchar(20) DEFAULT NULL COMMENT '装修@1-毛胚,2-简装,3-精装',
  `label_tag` varchar(200) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '房源标签&0-近地铁,1-近商圈,2-电梯楼,3-品质小区,4-品质小区,5-随时看房',
  `demand_type` varchar(255) DEFAULT NULL COMMENT '房需类型@0-租房,1-买房',
  `remarks` varchar(500) DEFAULT NULL COMMENT '备注',
  `version_no` int(5) NOT NULL COMMENT '版本号',
  `create_by` bigint(20) DEFAULT NULL COMMENT '创建人id',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '修改人id',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `delete_flag` varchar(6) NOT NULL COMMENT '逻辑删除@0-存在,1-隐藏,2-删除,3-停用',
  `sort` int(6) NOT NULL COMMENT '排序',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='需求信息';

